import React, { Component } from 'react';
import Auxiliary from '../../hoc/Auxiliary';
import jsonServerConfig from '../../src/configurations/json-server';

class TournamentsView extends Component {
	constructor(props) {
		super(props);

		this.state = {
			tournaments: [],
			isError: false
		};
	}

	render() {
		return (
			<Auxiliary>
				<div>Tournaments List</div>
			</Auxiliary>
		);
	}
}

export default WithTournamentsData('http://localhost:3005/tournaments')(TournamentsView);
